import React, { useState } from "react";
import ReactDOM from "react-dom";
import "./index.css";
const App=()=>{

const [first,last]=useState("awesome");
const [phla,dusra]=useState(" ");

const Fun=()=>{
  
  last("my name");

}
const Funs=()=>{
  
  dusra("my name");

}
return <>
<h1>{first} {phla}</h1>
  <button onClick={Fun}>click me</button>
  <button onDoubleClick={Funs}>click me</button>
</>
}



ReactDOM.render(
   <>
  
   <App />
    </>
 ,document.getElementById("root"));
